import React from "react";
import { ReactDOM } from "react";

class H20 extends React.Component {
  constructor(props) {
    super(props);
    this.state = { temp: 15 };
  }

  render() {
    return (
      <div>
        <h2>{this.state.temp}</h2>

      </div>
    );
  }
}

export default H20;
